        super(props);
        this.state = {
            
        };
        this.goToPage = this.goToPage.bind(this);
    }
    goToPage(pageID){
        var returnValue;
        
        switch(pageID)
        {
            case 0:
            returnValue = <Profile/>;
            break;
            case 1:
            returnValue = <App/>;
            break;
            default:
        }
        ReactDOM.render(returnValue, document.getElementById('mainFrame'));
    }
    render() {
      var co = this;
      return(
          <div>
        <button id="myProfile" onClick = {()=>{
          co.goToPage(0);
        }}>my profile</button>
      <button id="events" onClick = {()=>{
          co.goToPage(1);
        }}>show events</button>
      </div>
      );
    }
  }

export default LeftMenu;
